import{_ as a,o as e,c as n,X as o}from"./chunks/framework.65f9c974.js";const h=JSON.parse('{"title":"Plugin: Aurelium Skills","description":"","frontmatter":{},"headers":[],"relativePath":"mods/aureliumskills.md","filePath":"mods/aureliumskills.md"}'),r={name:"mods/aureliumskills.md"},i=o('<h1 id="plugin-aurelium-skills" tabindex="-1">Plugin: Aurelium Skills <a class="header-anchor" href="#plugin-aurelium-skills" aria-label="Permalink to &quot;Plugin: Aurelium Skills&quot;">​</a></h1><br><h2 id="descripcion" tabindex="-1">Descripción <a class="header-anchor" href="#descripcion" aria-label="Permalink to &quot;Descripción&quot;">​</a></h2><hr><blockquote><p>Este plugin te otorgará distintas habilidades que están aquí abajo descritas (traducidas a español por www.DeepL.com)</p></blockquote><div class="tip custom-block"><p class="custom-block-title">Habilidades:</p><p>Farming - Cosecha cultivos para ganar XP de Granja</p><p>Foraging - Corta árboles para ganar XP de Forrajeo</p><p>Mining - Extrae piedra y minerales para ganar XP de minería</p><p>Fishing - Pesca peces para ganar puntos de pesca</p><p>Excavation - Excava con una pala para ganar puntos de excavación</p><p>Archery - Dispara a los enemigos y a los jugadores con un arco para ganar experiencia de tiro con arco</p><p>Defense - Recibe daño de entidades para ganar XP de Defensa</p><p>Fighting - Lucha contra los monstruos con armas cuerpo a cuerpo para ganar experiencia de lucha</p><p>Endurance - Camina y corre para ganar puntos de resistencia</p><p>Agility - Salta y recibe daño de caídas para ganar XP de Agilidad</p><p>Alchemy - Prepara pociones para ganar puntos de alquimia</p><p>Enchanting - Encantar objetos y libros para ganar XP de Encantamiento</p><p>Sorcery - Usa habilidades de maná para ganar XP de Hechicería</p><p>Healing - Bebe y salpica pociones para ganar XP de Curación</p><p>Forging - Combina y aplica libros en un yunque para ganar puntos de forja</p></div><div class="tip custom-block"><p class="custom-block-title">Stats</p><p>Strength ➽ Incrementa el daño en el ataque</p><p>Health ❤ Incrementa la salud máxima</p><p>Regeneration ❥ Incrementa la salud y la velocidad con la que se te regenera el maná</p><p>Luck ☘ Incrementa tu suerte y la probabilidad de doble caída de los bloques comunes</p><p>Wisdom ✿ Aumenta la ganancia de experiencia, el maná máximo y reduce el coste de los yunques</p><p>Toughness ✦ Reduce el daño recibido</p></div><div class="tip custom-block"><p class="custom-block-title">Habilidades de Maná</p><p>Replenish (Farming) - Repone los cultivos automáticamente durante un tiempo determinado. Haz clic con el botón derecho con una azada y rompe un cultivo para activarlo. Funciona con trigo, zanahorias, patatas, verrugas y remolachas.</p><p>Treecapitator (Foraging) - Rompe árboles enteros al instante durante un tiempo determinado. Haz clic con el botón derecho del ratón con un hacha y rompe un tronco para activarlo. Funciona mejor con robles, abedules y píceas (una manzana de ancho). El algoritmo no es definitivo y se mejorará más adelante para que funcione perfectamente con todos los tipos de árboles.</p><p>Speed Mine (Mining) - Otorga prisa 10 durante un tiempo determinado. Haz clic con el botón derecho del ratón con un pico y rompe una piedra o un mineral para activarlo.</p><p>Sharp Hook (Fishing) - Inflige daño a una entidad enganchada al hacer clic con el botón izquierdo del ratón con una caña de pescar&#39;.</p><p>Terraform (Excavation) - Rompe bloques instantáneamente en un radio de 4 bloques en la misma capa al excavar. Debes usar una pala y los bloques extra rotos deben ser del mismo tipo y estar en una única veta conectada. Haz clic con el botón derecho en la pala y excava el bloque para activarlo.</p><p>Charged Shot (Archery) - Las flechas que dispares infligirán más daño en función de lo lejos que se haya tensado el arco, consumiendo maná en el proceso. Inflige más daño por maná consumido. Haz clic con el botón izquierdo en un arco para activar el modo de disparo cargado.</p><p>Absorption (Defense) - El daño recibido reducirá el maná en 2 veces el daño de Minecraft en lugar de tu salud. El maná no se regenerará mientras Absorción esté activa. Haz clic con el botón izquierdo en el escudo y recibe daño para activarla.</p><p>Lightning Blade (Fighting) - Aumenta la velocidad de ataque en un _% durante _ segundos. Haz clic con el botón derecho en la espada y ataca a la multitud para activarla.</p></div><br><h2 id="comandos" tabindex="-1">Comandos <a class="header-anchor" href="#comandos" aria-label="Permalink to &quot;Comandos&quot;">​</a></h2><hr><br><h3 id="consultar-tus-skills-ver-el-progreso-de-las-mismas" tabindex="-1">Consultar tus skills (ver el progreso de las mismas) <a class="header-anchor" href="#consultar-tus-skills-ver-el-progreso-de-las-mismas" aria-label="Permalink to &quot;Consultar tus skills (ver el progreso de las mismas)&quot;">​</a></h3><div class="language-"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#A6ACCD;">/skills</span></span></code></pre></div>',14),s=[i];function l(c,t,p,d,u,m){return e(),n("div",null,s)}const b=a(r,[["render",l]]);export{h as __pageData,b as default};
